angular.module("malariaApp")
    .controller('listCtrl',function($scope,$http){
        $scope.showList =false;
        $scope.getList = function(currentKaya){
            $scope.showList =false;
            $http.post("index.php/getkaya",currentKaya).success(function(res){
                $scope.data.kaya = res;
                $scope.showList =true;
            });
        }

        $scope.downloadData =function(){
            var doc = new jsPDF('p', 'pt');

// We'll make our own renderer to skip this editor
            var specialElementHandlers = {
                '#editor': function(element, renderer){
                    return true;
                }
            };

// All units are in the set measurement for the document
// This can be changed to "pt" (points), "mm" (Default), "cm", "in"
            var datas = [];
            var veo = "";
            var kituo = "";
            angular.forEach($scope.data.kaya,function(data){
                veo = data.name_of_veo
                kituo = data.station
                datas.push(
                    {'uid':data.uid,'sum':$scope.findSum(data),'nets':data.nets,'mpokeaji':'___________','sahihi':'_______'}
            );

            });
            var columns = [
                {title: "ID", key: "uid"},
                {title: "Idadi ya Watu", key: "sum"},
                {title: "Idadi ya vyandarua", key: "nets"},
                {title: "Jina la Mpokeaji", key: "mpokeaji"},
                {title: "Sahihi", key: "sahihi"}
            ];
            var data = datas;
//            doc.fromHTML(html, 15, 15, {
//                'width': 280,
//                'elementHandlers': specialElementHandlers
//            });
            var imgData = 'data:image/png;base64,'
            var imgData1 ='data:image/png;base64,';

            doc.setFontSize('13');
                doc.text(150, 18, "WIZARA YA AFYA NA USTAWI WA JAMII");
            doc.text(135, 35, "MPANGO WA TAIFA WA KUDHIBITI MALARIA");
            doc.setFontSize('9');
            doc.text(40, 55, "Wilaya:");
            doc.text(175, 55, "Kata:");
            doc.text(395, 55, "Kijiji:");
            doc.text(40, 68, "Jina La Veo:");
            doc.text(305, 68, "Kituo Cha Ugawaji:");

            doc.setFontStyle('bold');
            doc.text(90, 55, $("#wilaya option:selected").text());
            doc.text(235, 55, $("#kata option:selected").text());
            doc.text(425, 55, $("#kijiji option:selected").text());
            doc.text(140, 68, veo);
            doc.text(395, 68, kituo);
            var name = $("#mkoa option:selected").text() +"_"+$("#wilaya option:selected").text() +"_"+$("#kata option:selected").text() +"_"+$("#kijiji option:selected").text();
            doc.addImage(imgData1, 'PNG', 40, 5, 40, 40);
            doc.addImage(imgData, 'PNG', 500, 5, 40, 40);
            doc.autoTable(columns, data, {
                    padding: 3, // Horizontal cell padding
                    fontSize: 10,
                    lineHeight: 15,
                    renderHeader: function (doc, pageNumber, settings) {}, // Called before every page
                renderFooter: function (doc, lastCellPos, pageNumber, settings) {}, // Called on the end of every page
                renderHeaderCell: function (x, y, width, height, key, value, settings) {
                    doc.setFillColor(52, 73, 94); // Asphalt
                    doc.setTextColor(255, 255, 255);
                    doc.setFontStyle('bold');
                    doc.rect(x, y, width, height, 'F');
                    y += settings.lineHeight / 2 + doc.internal.getLineHeight() / 2 - 2.5;
                    doc.text('' + value, x + settings.padding, y);
                },
                renderCell: function (x, y, width, height, key, value, row, settings) {
                    doc.setFillColor(row % 2 === 0 ? 245 : 255);
                    doc.rect(x, y, width, height, 'F');
                    y += settings.lineHeight / 2 + doc.internal.getLineHeight() / 2 - 2.5;
                    doc.text('' + value, x + settings.padding, y);
                },
                margins: { horizontal: 40, top: 80, bottom: 40 }, // How much space around the table
                startY: false, // The start Y position on the first page. If set to false, top margin is used
                avoidPageSplit: false, // Avoid splitting table over multiple pages (starts drawing table on fresh page instead).
                extendWidth: true // If true, the table will span 100% of page width minus horizontal margins.
              });
            doc.save(name+'.pdf');

//            doc.save('test.pdf')

        }
    });